import React from 'react'

function Header()
{
    return(
       <header>
           <h1 style={headerStyle}> Reservation Lists</h1>
       </header> 
    )
}

const headerStyle = {
    background: '#333',
    color:  '#fff',
    textAlign: 'center',
    padding: '10px'
}
export default Header
